import React, { Component } from 'react';
import './page.css';

class Header extends Component {

  render() {
    const { text } = this.props;
    return (
      <div style='outline:none'>
        <header className='page-header'>
          <div className='page-header-text'>{ text }</div>
        </header>
      </div>
    );
  }
}

export default Header;
